import React from "react";
import { useKeycloak } from "@react-keycloak/web";
import Login from "./Login";

const Home = ({ children }) => {
  const { keycloak, initialized } = useKeycloak();

  if (!keycloak.authenticated) {
    return <Login />;
  }

  return <div>{children}</div>;
};

export default Home;
